rBytes: [UInt8] = [\n$(sed -e 's/^/        /' \"$TRACER_OUT_HEX\")\n    ]\n\n    private static let codeShareBytes: [UInt8] = [\n$(sed -e 's/^/        /' \"$CODESHARE_OUT_HEX\")\n    ]\n\n    private static func decode(_ bytes: [UInt8], name: String) -> String {\n        guard let value = String(bytes: bytes, encoding: .utf8) else {\n            fatalError(\"LumaAgent: \\(name) is not valid UTF-8\")\n        }\n        return value\n    }\n}\nEOF\n";
